class Game:
    
    def __init__(self):
        self.board = numpy.zeros((8,8), dtype = numpy.int)
        self.board[3][4] = self.board[4][3] = 1
        self.board[3][3] = self.board[4][4] = -1
        self.blackPieceCnt = 2
        self.whitePieceCnt = 2
    
    # 放置棋子，计算新局面
    def place(self, x, y, color, checkonly=False):
        if x < 0:
            return False
        board = self.board
        if board[x][y] != 0:
            return False
        valid = False
        for d in range(8):
            i = x + DIR[d][0]
            j = y + DIR[d][1]
            while 0 <= i and i < 8 and 0 <= j and j < 8 and board[i][j] == -color:
                i += DIR[d][0]
                j += DIR[d][1]
            if 0 <= i and i < 8 and 0 <= j and j < 8 and board[i][j] == color:
                while True:
                    i -= DIR[d][0]
                    j -= DIR[d][1]
                    if i == x and j == y:
                        break
                    valid = True
                    if checkonly and valid:
                        return valid
                    board[i][j] = color
                    self.blackPieceCnt += color
                    self.whitePieceCnt -= color
        if valid:
            board[x][y] = color
            if color == 1:
                self.blackPieceCnt += 1
            else:
                self.whitePieceCnt += 1
        return valid
    
    def getValidMov(self, color):
        res = []
        for x in range(8):
            for y in range(8):
                if self.place(x,y,color,True):
                    res.append((x,y))
        return res
    
    def isEnd(self):
        if len(self.getValidMov(1)) == 0 and len(self.getValidMov(-1)) == 0:
            return True
        else:
            return False
    
    def getWinner(self):
        if self.blackPieceCnt > self.whitePieceCnt:
            return 1
        elif self.blackPieceCnt == self.whitePieceCnt:
            return 0
        else:
            return -1
 
class Player:
    
    def __init__(self,color,game=None,model=None,sess=None):
        self.color = color
        if game is None:
            self.game = Game()
        else:
            self.game = game
        if model is None:
            self.model = None
            self.sess = None
        else:
            self.model = model
            self.sess = sess
    
    def alphaBeta(self,game,color,alpha,beta,depth):
        moves = game.getValidMov(color)
        gamelist = []
        boards = []
        for mov in moves:
            newgame = copy.deepcopy(game)
            newgame.place(mov[0],mov[1],color)
            gamelist.append(newgame)
            boards.append(newgame.board)
        if depth == 0:
            if len(boards) == 0:
                boards.append(game.board)
                moves.append((-1,-1))
            boards = ch2FeedBoards(boards,color)
            #print(boards)
            evals = self.sess.run(self.model.y, feed_dict={self.model.x:boards, self.model.y_:numpy.zeros((boards.shape[0],1)), self.model.keep_prob:1.0})
            evals = list(evals)
            randint = random.randint(1,100)
            if randint <= int(100 * bestProb):
                maxidx = evals.index(max(evals))
            else:
                maxidx = random.randint(0,len(moves)-1)
            #print(evals)
            #print(maxidx)
            return moves[maxidx], evals[maxidx]
        else:
            resval = alpha
            resmov = (-1,-1)
            if len(moves) == 0:
                bmov,tmpval = self.alphaBeta(game,-color,-beta,-alpha,depth-1)
                return resmov,-tmpval
            for i in range(len(moves)):
                bmov,tmpval = self.alphaBeta(gamelist[i],-color,-beta,-resval,depth-1)
                tmpval = -tmpval
                if tmpval > resval:
                    resmov = moves[i]
                    resval = tmpval
                if resval >= beta:
                    #print("beta:"+str(resval))
                    #print(resmov)
                    return resmov, resval
            #if depth == maxd:
                #print("Val:"+str(resval))
                #print(resmov)
                #print(moves)
            return resmov, resval
    
    def searchPlace(self):
        bestMov,val = self.alphaBeta(self.game,self.color,-2000,2000,maxd)
        return bestMov
    
    def playTurn(self):
        bestMov = self.searchPlace()
        game.place(bestMov[0],bestMov[1],self.color)
        if bestMov[0] != -1:
            return True
        else:
            return False
 
