def initGame(game):
    fullInput = json.loads(input())
    requests = fullInput["requests"]
    responses = fullInput["responses"]
    myColor = 1
    if requests[0]["x"] >= 0:
        myColor = -1
        game.place(requests[0]["x"], requests[0]["y"], -myColor)
    turn = len(responses)
    for i in range(turn):
        game.place(responses[i]["x"], responses[i]["y"], myColor)
        game.place(requests[i + 1]["x"], requests[i + 1]["y"], -myColor)
    return myColor,game

def ch2FeedBoards(boards,color):
   # print(boards)
    if color == -1:
        for i in range(len(boards)):
            b = boards[i]
            newb = numpy.zeros((8,8),dtype=numpy.int)
            for x in range(8):
                for y in range(8):
                    newb[x][y] = b[7-y][x]
            boards[i] = -newb
    
    return numpy.array(boards).reshape(-1,8,8,1) + 2

